static int tcl_gamma_breed_cmd(ClientData clientData,Tcl_Interp *interp, int objc, Tcl_Obj *const objv[]) {
    ClientData CD;
    int i,viable;
    PAT *p=(PAT *)Pdiffpair_output_nmos_circuits_PAT;
    int more_to_breed=1;
    while (more_to_breed&&(p->content->num_of<pat_size_target)) {
        more_to_breed=0;
        int sweep_size=p->content->num_of;
        for (i=0;i<sweep_size;i++) {
            if (p->content->content[i]->flags) continue;
            p->content->content[i]->flags=1;
            more_to_breed++;
            size_iref=p->content->content[i]->sizes->content[0];
            size_Wp=p->content->content[i]->sizes->content[1];
            size_Lp=p->content->content[i]->sizes->content[2];
            size_Wn=p->content->content[i]->sizes->content[3];
            size_Ln=p->content->content[i]->sizes->content[4];
            size_Ws=p->content->content[i]->sizes->content[5];
            size_Ls=p->content->content[i]->sizes->content[6];
            size_Wo=p->content->content[i]->sizes->content[7];
            size_Lo=p->content->content[i]->sizes->content[8];
            size_iref=size_iref+size_iref_step;
            viable=1;
            if ((size_iref>=size_iref_min)&&(size_iref<=size_iref_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_iref=size_iref-2*size_iref_step;
            viable=1;
            if ((size_iref>=size_iref_min)&&(size_iref<=size_iref_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_iref=size_iref+size_iref_step;
            size_Wp=size_Wp+size_Wp_step;
            viable=1;
            if ((size_Wp>=size_Wp_min)&&(size_Wp<=size_Wp_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Wp=size_Wp-2*size_Wp_step;
            viable=1;
            if ((size_Wp>=size_Wp_min)&&(size_Wp<=size_Wp_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Wp=size_Wp+size_Wp_step;
            size_Lp=size_Lp+size_Lp_step;
            viable=1;
            if ((size_Lp>=size_Lp_min)&&(size_Lp<=size_Lp_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Lp=size_Lp-2*size_Lp_step;
            viable=1;
            if ((size_Lp>=size_Lp_min)&&(size_Lp<=size_Lp_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Lp=size_Lp+size_Lp_step;
            size_Wn=size_Wn+size_Wn_step;
            viable=1;
            if ((size_Wn>=size_Wn_min)&&(size_Wn<=size_Wn_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Wn=size_Wn-2*size_Wn_step;
            viable=1;
            if ((size_Wn>=size_Wn_min)&&(size_Wn<=size_Wn_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Wn=size_Wn+size_Wn_step;
            size_Ln=size_Ln+size_Ln_step;
            viable=1;
            if ((size_Ln>=size_Ln_min)&&(size_Ln<=size_Ln_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Ln=size_Ln-2*size_Ln_step;
            viable=1;
            if ((size_Ln>=size_Ln_min)&&(size_Ln<=size_Ln_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Ln=size_Ln+size_Ln_step;
            size_Ws=size_Ws+size_Ws_step;
            viable=1;
            if ((size_Ws>=size_Ws_min)&&(size_Ws<=size_Ws_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Ws=size_Ws-2*size_Ws_step;
            viable=1;
            if ((size_Ws>=size_Ws_min)&&(size_Ws<=size_Ws_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Ws=size_Ws+size_Ws_step;
            size_Ls=size_Ls+size_Ls_step;
            viable=1;
            if ((size_Ls>=size_Ls_min)&&(size_Ls<=size_Ls_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Ls=size_Ls-2*size_Ls_step;
            viable=1;
            if ((size_Ls>=size_Ls_min)&&(size_Ls<=size_Ls_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Ls=size_Ls+size_Ls_step;
            size_Wo=size_Wo+size_Wo_step;
            viable=1;
            if ((size_Wo>=size_Wo_min)&&(size_Wo<=size_Wo_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Wo=size_Wo-2*size_Wo_step;
            viable=1;
            if ((size_Wo>=size_Wo_min)&&(size_Wo<=size_Wo_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Wo=size_Wo+size_Wo_step;
            size_Lo=size_Lo+size_Lo_step;
            viable=1;
            if ((size_Lo>=size_Lo_min)&&(size_Lo<=size_Lo_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Lo=size_Lo-2*size_Lo_step;
            viable=1;
            if ((size_Lo>=size_Lo_min)&&(size_Lo<=size_Lo_max)) {
                tcl_gamma_op_cmd(CD,NULL,0,NULL);
            }
            size_Lo=size_Lo+size_Lo_step;
            if (p->content->num_of%100==0) {
                printf("               %ld/%g=%g%%\n",p->content->num_of,pat_size_target,100*p->content->num_of/pat_size_target);
                fflush(stdout);
                if (param_unique>0) {
                    pat_unique(p,param_unique);
                }
            }
        }
        printf("   Done %ld/%g=%g%% (%ld visited)\n",p->content->num_of,pat_size_target,100*p->content->num_of/pat_size_target,more_to_breed);
    }
    return TCL_OK;
}
static int tcl_gamma_random_breed_cmd(ClientData clientData,Tcl_Interp *interp, int objc, Tcl_Obj *const objv[]) {
    ClientData CD;
    int i;
    PAT *p=(PAT *)Pdiffpair_output_nmos_circuits_PAT;
    long int r;
    float step;
    while (1) {
        if (p->content->num_of>pat_size_target) break;
        int sweep_size=p->content->num_of;
        for (i=0;i<sweep_size;i++) {
            size_iref=p->content->content[i]->sizes->content[0];
            size_Wp=p->content->content[i]->sizes->content[1];
            size_Lp=p->content->content[i]->sizes->content[2];
            size_Wn=p->content->content[i]->sizes->content[3];
            size_Ln=p->content->content[i]->sizes->content[4];
            size_Ws=p->content->content[i]->sizes->content[5];
            size_Ls=p->content->content[i]->sizes->content[6];
            size_Wo=p->content->content[i]->sizes->content[7];
            size_Lo=p->content->content[i]->sizes->content[8];
            while (1) {
                step=(2.0*random()/RAND_MAX-1)*size_iref_step;
                if (size_iref+step<size_iref_min) continue;
                if (size_iref+step>size_iref_max) continue;
                break;
            }
            size_iref+=step;
            while (1) {
                step=(2.0*random()/RAND_MAX-1)*size_Wp_step;
                if (size_Wp+step<size_Wp_min) continue;
                if (size_Wp+step>size_Wp_max) continue;
                break;
            }
            size_Wp+=step;
            while (1) {
                step=(2.0*random()/RAND_MAX-1)*size_Lp_step;
                if (size_Lp+step<size_Lp_min) continue;
                if (size_Lp+step>size_Lp_max) continue;
                break;
            }
            size_Lp+=step;
            while (1) {
                step=(2.0*random()/RAND_MAX-1)*size_Wn_step;
                if (size_Wn+step<size_Wn_min) continue;
                if (size_Wn+step>size_Wn_max) continue;
                break;
            }
            size_Wn+=step;
            while (1) {
                step=(2.0*random()/RAND_MAX-1)*size_Ln_step;
                if (size_Ln+step<size_Ln_min) continue;
                if (size_Ln+step>size_Ln_max) continue;
                break;
            }
            size_Ln+=step;
            while (1) {
                step=(2.0*random()/RAND_MAX-1)*size_Ws_step;
                if (size_Ws+step<size_Ws_min) continue;
                if (size_Ws+step>size_Ws_max) continue;
                break;
            }
            size_Ws+=step;
            while (1) {
                step=(2.0*random()/RAND_MAX-1)*size_Ls_step;
                if (size_Ls+step<size_Ls_min) continue;
                if (size_Ls+step>size_Ls_max) continue;
                break;
            }
            size_Ls+=step;
            while (1) {
                step=(2.0*random()/RAND_MAX-1)*size_Wo_step;
                if (size_Wo+step<size_Wo_min) continue;
                if (size_Wo+step>size_Wo_max) continue;
                break;
            }
            size_Wo+=step;
            while (1) {
                step=(2.0*random()/RAND_MAX-1)*size_Lo_step;
                if (size_Lo+step<size_Lo_min) continue;
                if (size_Lo+step>size_Lo_max) continue;
                break;
            }
            size_Lo+=step;
            int pre_volume=p->content->num_of;
            if (tcl_gamma_op_cmd(CD,NULL,0,NULL)==TCL_ERROR) {i--; continue;}
            if (pre_volume==p->content->num_of) {i--; continue;}
            if (p->content->num_of%1000==0) {
                printf("               %ld/%g=%g%% max gain=%g\n",p->content->num_of,pat_size_target,100*p->content->num_of/pat_size_target,max_Adc);
                printf("               %ld/%g=%g%%\n",p->content->num_of,pat_size_target,100*p->content->num_of/pat_size_target);
                fflush(stdout);
                if (param_unique>0) {
                    pat_unique(p,param_unique);
                    printf("               post unique: %ld/%g=%g%%\n",p->content->num_of,pat_size_target,100*p->content->num_of/pat_size_target);
                    if (p->content->num_of>0.92*pat_size_target) break;
                }
            }
            if (p->content->num_of>pat_size_target) break;
        }
        if (p->content->num_of>pat_size_target) break;
    }
    return TCL_OK;
}
